import React from "react";
import forecastImg from './image/forecast.png';
import percentImg from './image/percentage.png';
import {FormControl, Table} from "react-bootstrap";
import { InputGroup } from "react-bootstrap";
import { Button,ButtonGroup } from "react-bootstrap";
import {Container, Row, Col} from "react-bootstrap"



function OutputGraph() {
    return(
        <>
            <Container>
                <Row>
                    <div>
                        <img src={forecastImg} alt = "forecastImage"/>
                        <img src={percentImg} alt = "forecastImage"/>
                    </div>
                </Row>
                <div>
                    <Col xs={6}>
                        <ButtonGroup aria-label="Basic example">
                            <Button variant="secondary">Left</Button>
                            <Button variant="secondary">Middle</Button>
                            <Button variant="secondary">Right</Button>
                        </ButtonGroup>
                        <Button variant="primary" size="sm" >
                            Energy
                        </Button>{' '}
                        <Button variant="secondary" size="sm" >
                            Retail
                        </Button>{' '}
                        <Button variant="success" size="sm" >
                            Financial Services
                        </Button>{' '}
                        <Button variant="warning" size="sm" >
                            Pharmaceutical
                        </Button>{' '}
                    </Col>
                </div>
                <div>
                    <Col xs={6}>
                        <Button variant="primary" size="sm" >
                            Airline
                        </Button>{' '}
                        <Button variant="secondary" size="sm" >
                            Technology
                        </Button>{' '}
                        <Button variant="success" size="sm" >
                            Gaming
                        </Button>{' '}
                        <Button variant="warning" size="sm" >
                            Real Estate
                        </Button>{' '}
                    </Col>
                </div>
            </Container>
        </>


    );
};

export default OutputGraph;
